import React from 'react'
import Header from '../components/Header'

const Dashboard = () => {
	return (
		<div>
			<Header />
			<DataTable
				cellsName={['Id', 'Name', 'Cost', 'Add time', 'Image']}
				cellsData={[]}
			/>
		</div>
	)
}

export default Dashboard
